import React, { useState, useEffect } from "react";
import axios from "axios";

export default function Dashboard({ token }) {
  const [repos, setRepos] = useState([]);
  const [selectedRepo, setSelectedRepo] = useState(null);
  const [prs, setPrs] = useState([]);
  const [selectedPR, setSelectedPR] = useState(null);
  const [prDetails, setPrDetails] = useState(null);

  // Fetch repositories on load
  useEffect(() => {
    const fetchRepos = async () => {
      try {
        const res = await axios.get("http://localhost:5000/api/github/repos", {
          headers: { Authorization: `Bearer ${token}` }
        });
        setRepos(res.data);
      } catch (err) {
        console.error("Error fetching repos:", err);
      }
    };
    fetchRepos();
  }, [token]);

  // Fetch PRs when a repo is selected
  const handleRepoSelect = async (repo) => {
    setSelectedRepo(repo);
    setPrs([]);
    setSelectedPR(null);
    setPrDetails(null);

    try {
      const res = await axios.get(
        `http://localhost:5000/api/github/repos/${repo.owner.login}/${repo.name}/pulls`,
        {
          headers: { Authorization: `Bearer ${token}` }
        }
      );
      setPrs(res.data);
    } catch (err) {
      console.error("Error fetching PRs:", err);
    }
  };

  // Fetch PR details
  const handleViewDetails = async (pr) => {
    if (selectedPR === pr.number) {
      setSelectedPR(null);
      setPrDetails(null);
      return;
    }
    setSelectedPR(pr.number);
    try {
      const res = await axios.get(
        `http://localhost:5000/api/github/repos/${pr.base.repo.owner.login}/${pr.base.repo.name}/pulls/${pr.number}`,
        {
          headers: { Authorization: `Bearer ${token}` }
        }
      );
      setPrDetails(res.data);
    } catch (err) {
      console.error("Error fetching PR details:", err);
    }
  };

  return (
    <div style={{ padding: "20px" }}>
      <h2>GitHub Dashboard</h2>

      {/* Repo List */}
      <div>
        <h3>Your Repositories</h3>
        {repos.map((repo) => (
          <button
            key={repo.id}
            style={{
              margin: "5px",
              padding: "8px 12px",
              border: selectedRepo?.id === repo.id ? "2px solid blue" : "1px solid #ddd"
            }}
            onClick={() => handleRepoSelect(repo)}
          >
            {repo.name}
          </button>
        ))}
      </div>

      {/* PR List */}
      {selectedRepo && (
        <div style={{ marginTop: "20px" }}>
          <h3>Pull Requests for {selectedRepo.name}</h3>
          {prs.length === 0 ? (
            <p>No pull requests found.</p>
          ) : (
            prs.map((pr) => (
              <div
                key={pr.id}
                style={{
                  border: "1px solid #ddd",
                  padding: "10px",
                  marginBottom: "10px",
                  borderRadius: "5px"
                }}
              >
                <h4>{pr.title}</h4>
                <p>Status: {pr.state}</p>
                <p>By: {pr.user.login}</p>
                <button onClick={() => handleViewDetails(pr)}>
                  {selectedPR === pr.number ? "Hide Details" : "View Details"}
                </button>

                {/* PR Details */}
                {selectedPR === pr.number && prDetails && (
                  <div style={{ marginTop: "15px" }}>
                    <h4>Commits</h4>
                    <ul>
                      {prDetails.commits.map((commit) => (
                        <li key={commit.sha}>
                          <strong>{commit.commit.message}</strong> â€”{" "}
                          {commit.commit.author.name} on{" "}
                          {new Date(commit.commit.author.date).toLocaleString()}
                        </li>
                      ))}
                    </ul>

                    <h4>File Changes</h4>
                    {prDetails.files.map((file) => (
                      <div key={file.filename} style={{ marginBottom: "15px" }}>
                        <strong>{file.filename}</strong>
                        <pre
                          style={{
                            background: "#f6f8fa",
                            padding: "10px",
                            overflowX: "auto",
                            whiteSpace: "pre-wrap",
                            fontSize: "0.9em"
                          }}
                        >
                          {file.patch || "No diff available"}
                        </pre>
                      </div>
                    ))}
                  </div>
                )}
              </div>
            ))
          )}
        </div>
      )}
    </div>
  );
}
